@media only screen and (max-width: 480px) {
  .pure-form input[type="search"] { display: block; }
}

@media (max-width: 480px) {
  .central-textlogo { position: relative; height: 70px; width: auto; margin: 2rem 0px 0px; text-align: center; line-height: 2.5rem; text-indent: -1rem; font-size: 1em; }
  .central-textlogo-wrapper { position: relative; top: 12px; text-indent: 0.2rem; }
  .svg-Wikipedia_wordmark { width: 150px; height: 25px; background-position: 0px -260px; background-size: 100%; }
  .localized-slogan { font-size: 1.4rem; }
  .central-featured-logo { position: relative; display: inline-block; width: 57px; height: auto; left: 0px; top: 0px; }
}

@media (max-width: 480px) {
  .central-featured { width: auto; height: auto; margin-top: 8rem; font-size: 1.3rem; text-align: left; }
  .central-featured::after { content: " "; display: block; visibility: hidden; clear: both; height: 0px; font-size: 0px; }
  .central-featured-lang { display: block; float: left; position: relative; top: auto; left: auto; right: auto; box-sizing: border-box; height: 6.4rem; width: 33%; margin: 0px 0px 16px; padding: 0px 1.6rem; font-size: 1.4rem; text-align: center; }
  .central-featured-lang strong { font-size: 1.4rem; margin-bottom: 4px; }
  .central-featured-lang small { line-height: 1.4; }
}

@media only screen and (max-width: 480px) {
  .search-container .pure-form fieldset { margin-left: 1rem; margin-right: 6.6rem; }
  .search-container .search-input { width: 100%; margin-right: -6.6rem; }
  .search-container .pure-form button { float: right; right: -5.6rem; }
}

@media (max-width: 480px) {
  .langlist { font-size: inherit; }
  .langlist a { overflow-wrap: break-word; white-space: normal; }
  .lang-list-container { width: auto; margin-left: 0.8rem; margin-right: 0.8rem; }
  .bookshelf { overflow: visible; }
}

@media (max-width: 480px) {
  .bookshelf { width: auto; left: auto; }
  .bookshelf-container { text-align: left; width: auto; }
}

@media screen and (max-width: 768px) {
  .app-badges .footer-sidebar-content { text-align: center; }
  .app-badges .sprite.footer-sidebar-icon { display: inline-block; position: relative; margin: 0px; top: -3px; left: 0px; vertical-align: middle; transform: scale(0.7); }
}

@media screen and (max-width: 768px) {
  .footer { display: flex; flex-direction: column; padding-top: 1.28rem; }
  .footer .footer-sidebar { order: 1; }
  .footer .other-projects { order: 2; }
  .footer .app-badges { order: 3; }
  .footer hr { order: 4; }
  .footer .site-license { order: 5; }
  .footer-sidebar { width: 100%; }
  .sprite.footer-sidebar-icon { display: block; position: relative; left: 0px; margin: 0px auto 1.28rem; }
  .footer-sidebar-content { max-width: none; }
  .footer-sidebar-text { margin: 0px; padding: 0px; text-align: center; }
}

@media (max-width: 480px) {
  .search-container { margin-top: 0px; height: 7.8rem; position: absolute; top: 9.6rem; left: 0px; right: 0px; max-width: 100%; width: auto; padding: 0px; text-align: left; }
  .search-container label { display: none; }
  .search-form #searchInput { max-width: 40%; vertical-align: middle; }
  .search-form .formBtn { max-width: 25%; vertical-align: middle; }
  form fieldset { margin: 0px; border-left: 0px; border-right: 0px; }
  hr { margin-top: 0.65rem; }
}

@media print {
  body { background-color: transparent; }
  a { color: rgb(0, 0, 0) !important; background: none !important; padding: 0px !important; }
  a:link, a:visited { color: var(--color-print--visited); background: transparent; }
  img { border: 0px; }
}

